import React from 'react';
import NavbarStyle from './Navbar.module.scss';
import logo from './Images/logo.webp';
import {BrowserRouter as Router , Link} from 'react-router-dom';
const Navbar = () => {
	return (
		<div>
			<nav className={`container `} >
				<div className={`navbar ${NavbarStyle.navbar} `}>
					<a className="navbar-brand">
						<img src={logo} alt="Portfolio" />
					</a>
					<div className={`${NavbarStyle.navItems}`}>
						<div><a className={NavbarStyle.navlink} href="#" >Home</a></div>
						<div><a className={NavbarStyle.navlink} href="#" >About</a></div>
						<div><a className={NavbarStyle.navlink} href="#" >Services</a></div>
						<div><a className={NavbarStyle.navlink} href="#" >Portfolio</a></div>
						<div><Link className={NavbarStyle.navlink}  >Page</Link></div>
						<div><a className={NavbarStyle.navlink} href="#" >Contact</a></div>
						<div className={NavbarStyle.navbutton}><a href="#"  className={NavbarStyle.navbuttonlink}><span className={NavbarStyle.navbuttontext}>Get Free Consultant</span></a></div>
					</div>
				</div>
			</nav >
			<h1>HI</h1>
		</div>

	);
}
export default Navbar;
